column13:
A radiation curable coating comprising: 

(i) at least one radiation polymerizable reactant; 

(ii) at least one initiator for initiating cure; 

(iii) at least one wax; 

wherein the wax is present in an amount sufficient to reduce the 60 gloss of the cured coating to a gloss level less than 40 when the coating is cured by exposure to radiation in the presence of oxygen to provide a dry film thickness of 1.00.1 mil.

A radiation curable coating comprising: 

(iv) at least one radiation polymerizable reactant; 

(v) at least one initiator for initiating cure; 

(vi) at least one wax; 

wherein the wax is present in an amount sufficient to reduce the 60 gloss of the cured coating to a gloss level less than 40 when the coating is cured by exposure to radiation in the presence of oxygen to provide a dry film thickness of 1.00.1 mil.

